import {useState} from 'react';

function Counter(){
    const [count, setCount] = useState(0);
    return (
        <>
        <button onClick={() => setCount(count++)}>Increment</button>
        <button onClick={() => setCount(count--)}>Decrement</button>
        <div>{count}</div>
        </>
    )

}
export default Counter;
